import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React, {useState} from 'react';
import './App.css';
import Home from './components/Home';
import NavBar from './components/NavBar';
import SpartanAbode from '../src/components/SpartanAbode';
import Testimonials from './components/Testimonials';
import PropTypes from 'prop-types';
import { TxtStyleProvider } from '../src/components/TxtStyleContext';
function App() {
  return (
    <div>
    <NavBar name="Vinayak Santhosh"/>
    <BrowserRouter>
    <TxtStyleProvider>
        <Routes>
          <Route path='/' element={<Home/>}></Route>
          <Route path='/about' element={<SpartanAbode/>}></Route>
          <Route path='/testimonial' element={<Testimonials/>}></Route>
        </Routes>
    </TxtStyleProvider>
    </BrowserRouter>
    </div>
  );
}

export default App;
